import React from 'react'

export default function Random(props) {
    return (
        <>
            <h1 className='text-6xl'>
                Random words
            </h1>
        </>
    )
}

Random.getInitialProps = async () => {
    try {
        const data = await fetch('https://jsonplaceholder.typicode.com/todos')
        .then(response => response.json())
        .then(json => json)

        return { data }
    } catch (error) {
        
    }
}
